import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Table from 'react-bootstrap/Table';
import { useNavigate } from 'react-router-dom'
import { BsSearch } from "react-icons/bs";
 

const Other = () => {

    const navigate = useNavigate()
    const sessionToken = sessionStorage.getItem("loggedIn");
    const [data, setData] = useState({});

    useEffect(() => {
        if(!sessionToken)
        {
            navigate('/login');
        }
        const getData = async () => {
            const {data: res} = await axios.get('http://localhost:8000/api/admin');
            setData(res);
                
        }
        getData();
    }, [])
    
    console.log(data);
    return(
        <>
            {sessionToken &&
            <div className='container d-flex justify-content-center'>
                <div className="card text-center">
                    <div className="card-header">
                        Admin
                    </div>
                    <div className='card-body'>
                    <div class="input-group">
                        <div class="form-outline">
                            <input  type="search" id="form1" class="form-control" placeholder='search...'/>
                        </div>
                        <button id="search-button" type="button" class="btn btn-primary">
                            <BsSearch />
                        </button>
                    </div>
                        <Table striped bordered>
                            <thead>
                                <tr>
                                <th>ID</th>
                                <th>Name,Lastname</th>
                                <th>Status</th>
                                <th>Action</th>
                                </tr>
                            </thead>
                            <tbody>
                                {data.orders?.map((order, index) => (
                                    <tr key={index}>
                                        <td>{order.order_nr}</td>
                                        <td>{order.tickets?.name[0]} {order.tickets?.lastname[0]}</td>
                                        <td>{order.active}</td>
                                        <td>
                                            <button className='btn btn-primary admin-table'>Accept</button>
                                            <button className='btn btn-primary admin-table'>Cancel</button>
                                            <button className='btn btn-primary admin-table'>Info</button>
                                        </td>
                                    </tr>
                                ))}
                                {/* <tr>
                                    <td>ASDDR88</td>
                                    <td>Rokas Saudargis</td>
                                    <td>0</td>
                                    <td>
                                        <button className='btn btn-primary admin-table'>Accept</button>
                                        <button className='btn btn-primary admin-table'>Cancel</button>
                                        <button className='btn btn-primary admin-table'>Info</button>
                                    </td>
                                </tr>
                                <tr>
                                    <td>ASDDR88</td>
                                    <td>Rokas Saudargis</td>
                                    <td>0</td>
                                    <td>
                                        <button className='btn btn-primary admin-table'>Accept</button>
                                        <button className='btn btn-primary admin-table'>Cancel</button>
                                        <button className='btn btn-primary admin-table'>Info</button>
                                    </td>
                                </tr> */}
                            </tbody>
                        </Table>
                    </div>
                </div>
            </div>
            }
        </>
    )
}

export default Other;
